import React from 'react'
import './App.css';
import { flightS } from "./flights";

function App() {
  return (
    <>
      <div className="stock-container">
        {flightS.map((data, key) => {
          return (
            <div key={key}>
              {data.ident +
                " , " +
                data.ticker +
                " ," +
                data.stockPrice +
                ", " +
                data.timeElapsed}
            </div>
          );
        })}
      </div>
    </>
  );
}
export default App;
